import styled from 'styled-components';


export const Wrapper = styled.div `
	{	
		margin: 20px auto;
		font-size: 1em;
		width: 100%;
		height: 100%;
		position: relative;
        text-align: center;
	}
`;

export const Content = styled.div `
    margin: 1em 0;
    width: 30%;
	min-width: 13em;
    float: left;
    padding-left: 3em;
    padding-top: 3em;

    .form {
      padding-bottom: 5em;
    }

`;


export const picture = styled.div `
    margin: 1em 0;
    width: 30%;
	min-width: 13em;
    float: left;
    padding-left: 3em;
    padding-top: 3em;

    .form {
      padding-bottom: 5em;
    }

`;
